function RecentStopWatch() {
    useEffect(() => {
        fetch('http://localhost:3001/timer', {
            method: "GET",
        }
        ).then(res => { if (res.ok) { console.log("GET") } })

    })
    return (
        <section>
            지난 데이터
        </section>
    )
}

export default RecentStopWatch;
